def DistanceBetweenTwoPoints(x_1, y_1, x_2, y_2):
    """ Use Pythagorean Theorem to calculate displacement of two objects with known 'x' & 'y' coordinates. """
    distance = []
    for x1, y1, x2, y2 in zip(x_1, y_1, x_2, y_2):
        distance.append(np.sqrt((x1 - x2)**2 + (y1 - y2)**2))
    return distance


def CalculateAnaphaseDistancePerMovie(tracks_directory):
    """

    :param tracks_directory:    (str)
    :return: cell_count:        (list)
             parent_child_1:    (list)
             parent_child_2:    (list)
             sibling_sibling:   (list)
    """

    # Make sure the directory ends with an '/' & the file is unzipped:
    if not tracks_directory.endswith("/"):
        tracks_directory += "/"

    hdf5_file = tracks_directory.split("/tracks/")[0] + "/HDF/segmented.hdf5"
    cell_count = []
    x_parent = []
    y_parent = []
    x_children = [[] for _ in range(2)]
    y_children = [[] for _ in range(2)]

    # Loop through both channels if they exist:
    for channel in ["GFP", "RFP"]:
        # Make sure individual track_XFP.json files are unzipped:
        UnzipTrackJSONfiles(tracks_directory=tracks_directory, channel=channel)
        extract_dir = tracks_directory + "tracks_{}/".format(channel)

        if os.path.isdir(extract_dir):
            for file_parent in os.listdir(extract_dir):
                file_parent = extract_dir + file_parent
                #print ("Parent: {}".format(file_parent))

                with open(file_parent) as json_file:
                    data = json.load(json_file)
                    if data['fate'] == "DIVIDE":
                        x_parent.append(data['x'][-1])
                        y_parent.append(data['y'][-1])

                        # Find out when the division happens (=frame) and how many cells there were at that point:
                        division_frame = int(data['t'][-1])
                        x_gfp, _, x_rfp, _ = GetXandYcoordinatesPerFrame(hdf5_file=hdf5_file, frame=division_frame)
                        cell_count.append(len(x_gfp + x_rfp))
                        # print ("{} cells in frame #{}".format(cell_count, division_frame))

                        # Check if both children files exist:
                        file_child_1 = extract_dir + "track_{}_{}.json".format(int(data['children'][0]), channel)
                        file_child_2 = extract_dir + "track_{}_{}.json".format(int(data['children'][1]), channel)

                        if os.path.isfile(file_child_1) and os.path.isfile(file_child_2):
                            for index, file_child in enumerate([file_child_1, file_child_2]):
                                #print ("Child #{}: {}".format(index, file_child))
                                with open(file_child) as json_file:
                                    new_data = json.load(json_file)
                                    x_children[index].append(new_data['x'][0])
                                    y_children[index].append(new_data['y'][0])
                        else:
                            del cell_count[-1]
                            del x_parent[-1]
                            del y_parent[-1]

    # Prepare the lists with distances instead of raw data coordinates:

    parent_child_1 = DistanceBetweenTwoPoints(x_1=x_parent, y_1=y_parent, x_2=x_children[0], y_2=y_children[0])
    parent_child_2 = DistanceBetweenTwoPoints(x_1=x_parent, y_1=y_parent, x_2=x_children[1], y_2=y_children[1])
    sibling_sibling = DistanceBetweenTwoPoints(x_1=x_children[0], y_1=y_children[0], x_2=x_children[1], y_2=y_children[1])

    return cell_count, parent_child_1, parent_child_2, sibling_sibling

